import { Box, HStack, VStack } from "@chakra-ui/react";

const  Main = () =>{
    return (<main>
        <Box>
            <HStack>
                <VStack>
                    <p>Little Lemon</p>
                    <p>Chicago</p>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit,
                         sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
                </VStack>
            </HStack>
        </Box>
    </main>);
};

export default Main;
